),(55,'Телец','undefined',156,50,NULL,'Европейская','Нет','высшее','Гетеро','Не курю','Пью в компаниях изредка','Нет',NULL,NULL,27,' Была сегодня в 10:02','http://www.mamba.ru/ru/Asteriaolga?hit=10&fromsearch&sp=15',NULL,NULL,NULL,'2015-01-08 10:39:36',1,'Asteriaolga'),(56,'Водолей','Я старомодна. Я считаю, что мужчина должен уступать мне место в транспорте, даже если я не беременная и без огромных пакетов. Да, он должен открывать дверь передо мной и подавать мне руку, когда я выхожу из автобуса, даже если мы не знакомы и никогда не будем знакомы. Я - женщина, а значит я слабее. Я старомодна. Я уверена, что мужчина должен платить за меня в ресторане или в кино - и у меня даже не должно возникнуть вопросов, а кто сегодня платит. Я старомодна. Я думаю, что мужчина должен заботиться обо мне - спрашивать, надела ли я теплый шарф и не забыла ли я покушать. Если я встречаюсь с мужчиной - значит я вижу в нем своего будущего мужа и отца своих детей. Да, он должен позвать меня замуж, если наши отношения действительно серьезны, и познакомить меня с родителями, собакой и лучшим другом. Я считаю, что готовить еду, стирать белье и гладить рубашки моего мужчины - моя историческая обязанность, и я вижу в этом истинное женское счастье - заботиться о своем мужчине. Я считаю, что мужчина должен быть грубоватым, смелым и сильным. Чтобы я могла быть нежной слабой трусишкой, о которой так приятно заботиться. И даже если я сильная, я должна быть слабой. Я думаю, что мы должны быть честны друг с другом. Мы вместе, а значит мы должны уважать друг друга и уважать свой выбор. Я не лягу спать, если он задерживается с работы, рыбалки или футбола. Я буду ждать у окна и греть ужин, пока он поднимается по лестнице. Я хочу выглядеть хорошо ради него, чтобы он оценил и подумал, какая же я у него красивая. Поэтому я трачу и буду тратить столько сил, чтобы нравиться ему. Я старомодна. Я хочу быть только его женщиной, и ничьей больше. Вчера, сегодня и всю жизнь. Даже если его сошлют в ссылку и назовут врагом народа. ',178,60,'Обычное','Европейская',NULL,'высшее',NULL,'Не курю','Пью в компаниях изредка','Есть, живём вместе',NULL,'Отдельная квартира (снимаю или своя)',29,' Была сегодня в 01:21','http://www.mamba.ru/ru/atasha2811?hit=10&fromsearch&sp=145',NULL,NULL,NULL,'2015-01-08 10:39:45',1,'atasha2811'),(57,'Лев','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,' Была месяц назад','http://www.mamba.ru/ru/batruha2009?hit=10&fromsearch&sp=72',NULL,NULL,NULL,'2015-01-08 10:39:50',1,'batruha2009'),(58,'Овен','Такого же скромняжечку как и я!',168,NULL,NULL,NULL,'Нет','высшее','Гетеро','Не курю',NULL,'Нет',NULL,NULL,31,' Была в течение недели','http://www.mamba.ru/ru/boginichka?hit=10&fromsearch&sp=109',NULL,NULL,NULL,'2015-01-08 10:39:59',1,'boginichka'),(59,'Козерог','undefined',NULL,NULL,'Обычное','Европейская','Нет',NULL,'Гетеро','Курю','Пью в компаниях изредка',NULL,'Непостоянные заработки',NULL,28,' Была месяц назад','http://www.mamba.ru/ru/bugagawki?hit=10&fromsearch&sp=20',NULL,NULL,NULL,'2015-01-08 10:40:07',1,'bugagawki'),(60,'Овен','undefined',NULL,NULL,'Обычное','Европейская','Нет',NULL,'Гетеро','Курю','Пью в компаниях изредка','Нет',NULL,'Отдельная квартира (снимаю или своя)',26,' Была давно','http://www.mamba.ru/ru/bukadasha?hit=10&fromsearch&sp=70',NULL,NULL,NULL,'2015-01-08 10:40:16',1,'bukadasha'),(61,'Стрелец','Нормального',170,69,'Плотное','Европейская','Нет',NULL,'Гетеро','Курю','Пью в компаниях изредка','Есть, живём вместе','Постоянный небольшой доход','Живу с приятелем / с подругой',30,' Была сегодня в 10:17','http://www.mamba.ru/ru/chaplygina_1984?hit=10&fromsearch&sp=133',NULL,NULL,NULL,'2015-01-08 10:40:24',1,'chaplygina_1984'),(62,'Козерог','undefined',173,52,'Худощавое',NULL,'В браке',NULL,NULL,NULL,NULL,'Есть, живём вместе',NULL,NULL,31,' Была в течение месяца','http://www.mamba.ru/ru/cilka83?hit=10&fromsearch&sp=70',NULL,NULL,NULL,'2015-01-08 10:40:33',1,'cilka83'),(63,'Водолей','undefined',170,54,NULL,NULL,NULL,