остоянный небольшой доход','Живу с родителями',29,' Была сегодня в 09:51','http://www.mamba.ru/ru/mb1053544650?hit=10&fromsearch&sp=119',NULL,NULL,NULL,'2015-01-08 11:49:06',1,'mb1053544650'),(213,'Овен','undefined',NULL,NULL,'Спортивное',NULL,'В браке',NULL,'Гетеро','Не курю','Пью в компаниях изредка','Нет',NULL,'Отдельная квартира (снимаю или своя)',24,' Была давно','http://www.mamba.ru/ru/mb1058438214?hit=10&fromsearch&sp=119',NULL,NULL,NULL,'2015-01-08 11:49:14',1,'mb1058438214'),(214,'Весы','undefined',167,53,'Спортивное',NULL,'Нет','высшее','Гетеро',NULL,NULL,NULL,'Стабильный средний доход','Отдельная квартира (снимаю или своя)',26,' Была неделю назад','http://www.mamba.ru/ru/mb1058926556?hit=10&fromsearch&sp=28',NULL,NULL,NULL,'2015-01-08 11:49:22',1,'mb1058926556'),(215,'Стрелец','undefined',164,NULL,NULL,'Коренная американка',NULL,'высшее','Гетеро','Не курю','Пью в компаниях изредка','Нет, но хотелось бы',NULL,NULL,28,' Была вчера в 09:25','http://www.mamba.ru/ru/mb1059865182?hit=10&fromsearch&sp=8',NULL,NULL,NULL,'2015-01-08 11:49:31',1,'mb1059865182'),(216,'Рыбы','undefined',NULL,NULL,NULL,'Европейская',NULL,NULL,'Гетеро',NULL,NULL,NULL,NULL,NULL,29,' Была вчера в 21:46','http://www.mamba.ru/ru/mb1060603704?hit=10&fromsearch&sp=119',NULL,NULL,NULL,'2015-01-08 11:49:39',1,'mb1060603704'),(217,'Телец','undefined',169,52,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,30,' Была вчера в 20:26','http://www.mamba.ru/ru/mb1062492114?hit=10&fromsearch&sp=62',NULL,NULL,NULL,'2015-01-08 11:49:47',1,'mb1062492114'),(218,'Козерог','Каждый ищет того, с кем ему хорошо и уютно — и тогда становится не важно, какой у тебя вес, цвет волос, рост… Важно совсем другое — важно то, какое место ты занимаешь в жизни этого человека.\nВсё что я ищу в мужчине - это уверенность в завтрашнем дне. Знать, что ты любима и желанна. Уважение, без которого нет крепких отношений, доверие, которым не пренебрегают. Рядом с достойным и ты хочешь стать достойной. Женщина тень мужчины, куда он ее поведет, туда она и последует. Любви без слов, но с множеством сумасшедших поступков. С таким мужчиной я, крепко взяв за руку, пойду с ним по жизненному пути.',NULL,NULL,'Обычное','Европейская','Нет','высшее',NULL,'Не курю',NULL,'Нет',NULL,NULL,28,' Была сегодня в 10:34','http://www.mamba.ru/ru/mb1074451170?hit=10&fromsearch&sp=117',NULL,NULL,NULL,'2015-01-08 11:49:54',1,'mb1074451170'),(219,'Рак','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,' Была давно','http://www.mamba.ru/ru/mb1075430711?hit=10&fromsearch&sp=62',NULL,NULL,NULL,'2015-01-08 11:50:05',1,'mb1075430711'),(220,'Близнецы','надежного, активного, позитивного...да и просто свою половинку в жизни.',174,62,'Спортивное','Европейская','Ничего серьёзного','неполное высшее','Гетеро','Не курю','Пью в компаниях изредка','Нет, но хотелось бы','Стабильный средний доход','Нет постоянного жилья',28,' Была давно','http://www.mamba.ru/ru/mb1077566335?hit=10&fromsearch&sp=118',NULL,NULL,NULL,'2015-01-08 11:50:12',1,'mb1077566335'),(221,'Рак','undefined',165,NULL,'Полное','Смешанная',NULL,NULL,'Гетеро',NULL,NULL,NULL,NULL,NULL,24,'undefined','http://www.mamba.ru/ru/mb1079135091?hit=10&fromsearch&sp=118',NULL,NULL,NULL,'2015-01-08 11:50:21',1,'mb1079135091'),(222,'Близнецы','undefined',NULL,NULL,'Обычное',NULL,'Нет','высшее',NULL,'Курю редко','Пью в компаниях изредка','Нет','Стабильный средний доход',NULL,23,' Была вчера в 23:32','http://www.mamba.ru/ru/mb1080421257?hit=10&fromsearch&sp=98',NULL,NULL,NULL,'2015-01-08 11:50:29',1,'mb1080421257'),(223,'Рак','undefined',177,62,NULL,'Европейская',NULL,'высшее',NULL,'Не курю','Пью в компаниях изредка',NULL,NULL,NULL,29,' Была вчера в 16:55','http://www.mamba.ru/ru/mb1097742172?hit=10&fromsearch&sp=18',NULL,NULL,NULL,'2015-01-08 11:50:38',1,'mb1097742172'),(224,'Близнецы','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,27,' Была давно','http://www.mamba.ru/ru/mb1104494774?hit=10&fromsearch&sp=62',NULL,NULL,NULL,'2015-01-08 11:50:44',1,'mb1104494774'),(225,'Водолей','Мужчину для серьезных стабильных отношений.В поиске своей половинки, если повезет конечно. Мне не скучно с собой и я не боюсь быть одна, мне мужчина нужен для души, для тела...Для жизни...чтобы грустить и радоваться вместе с ним.Да я такая:со своим темпераментом, со своей привлекательностью.\n\n*\n\nЯ хочу, чтобы однажды ты просто постучал в мою дверь и стоял на пороге с букетом цветов, я бы ничего не сказала, а ты просто подошёл и поцеловал, ничего не говоря... А потом крепко обнял и сказал \"Солнышко, я люблю тебя больше всего на свете и никогда больше не отпущу...\n\n*\n\nИнтересно, мои мысли знают, что они должны сбыться?\n\n*\n\nГлупо судить обо мне по тому, что я здесь пишу. Мой мир не ограничивается рамками интернета и есть вещи, которые я никогда не выставлю на всеобщее обозрение. Так, что, пожалуйста, давайте без выводов...',NULL,62,'Обычное','Европейская','Нет','высшее','Гетеро','Не курю',NULL,NULL,NULL,NULL,30,' Была давно','http://www.mamba.ru/ru/mb1105118739?hit=10&fromsearch&sp=62',NULL,NULL,NULL,'2015-01-08 11:50:50',1,'mb1105118739'),(226,'Рак','Никого себе не ищу. И кстати, мужики, ну хватит уже предлагать свои тела. Вы как дешевые проститутки, ей-богу! Уважать же себя надо, достоинства иметь!',165,NULL,'Обычное',NULL,NULL,'высшее','Гетеро','Курю',NULL,NULL,'Хорошо зарабатываю / обеспечена','Отдельная квартира (снимаю или своя)',25,' Была в течение недели','http://www.mamba.ru/ru/mb1109079868?hit=10&fromsearch&sp=48',NULL,NULL,NULL,'2015-01-08 11:50:59',1,'mb1109079868'),(227,'Скорпион','Любимого человека, свою половинку.',170,57,'Обычное','Европейская','Нет','высшее','Гетеро','Не курю','Не пью вообще','Есть, живём вместе','Стабильный средний доход',NULL,24,' Была давно','http://www.mamba.ru/ru/mb1111643768?hit=10&fromsearch&sp=62',NULL,NULL,NULL,'2015-01-08 11:51:09',1,'mb1111643768'),(228,'Козерог','undefined',168,50,'Обычное',NULL,NULL,NULL,'Гетеро','Не курю',NULL,NULL,'Стабильный средний доход',NULL,