чуг, ни автомобили.\n\nНи клубы и шмотки - от Gucci и Prado…\n\nА маленький домик, с беседкой и садом.\n\nСобаку с забавной и длинною кличкой.\n\nИ пару (не более) вредных привычек.\n\nСемейные вылазки в лес за грибами.\n\nШашлык во дворе, по субботам, с друзьями.\n\nЗимой, завсегда, лыжные эстафеты.\n\nА летом… О боже, что было бы летом!\n\nСоленья, компоты, полив помидоров.\n\nИ редкие – так, от усталости – ссоры.\n\nМой чай со смородиною и мелиссой\n\nв постель. Или вечером - под телевизор.\n\nЗакаты и стрёкот сверчков на террасе.\n\nШептание на ухо: «Ты - мое счастье»…\n\nДва ангела в доме, сопящих в кровати.\n\nТы, тихо снимающий летнее платье\n\nс меня, чтоб детей не будить…Твои руки,\n\nкоторых мне так не хватало б в разлуке\n\nпусть даже недолгой - по будням, когда мы\n\nс тобой на работе… Я б очень скучала…\n\nНо снова суббота. Потом воскресенье.\n\nМы дома, все вместе, с клубничным вареньем\n\nпьем чай со смородиною и мелиссой…',NULL,NULL,NULL,NULL,'Нет','высшее',NULL,NULL,NULL,'Есть, живём вместе','Хорошо зарабатываю / обеспечена',NULL,28,'undefined','http://www.mamba.ru/ru/mb1186390829?hit=10&fromsearch&sp=108',NULL,NULL,NULL,'2015-01-08 12:17:29',0,'mb1186390829'),(381,'Россия','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,28,' Была давно','http://www.mamba.ru/ru/mb1186597053?hit=10&fromsearch&sp=108',NULL,NULL,NULL,'2015-01-08 12:17:36',0,'mb1186597053'),(382,'Дева','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,27,' Была давно','http://www.mamba.ru/ru/mb1186620438?hit=10&fromsearch&sp=58',NULL,NULL,NULL,'2015-01-08 12:17:42',0,'mb1186620438'),(383,'Россия','undefined',173,58,'Спортивное',NULL,'Ничего серьёзного','два или более высших',NULL,'Не курю','Пью в компаниях изредка','Нет','Хорошо зарабатываю / обеспечена','Отдельная квартира (снимаю или своя)',24,' Была вчера в 00:09','http://www.mamba.ru/ru/mb1187029376?hit=10&fromsearch&sp=108',NULL,NULL,NULL,'2015-01-08 12:17:51',0,'mb1187029376'),(384,'Во