,'mb1196127418'),(419,'Телец','А знаешь, чего я хотела бы, милый?\n\nНи норку, ни жемчуг, ни автомобили.\n\nНи клубы и шмотки - от Gucci и Prado…\n\nА маленький домик, с беседкой и садом.\n\nСобаку с забавной и длинною кличкой.\n\nИ пару (не более) вредных привычек.\n\nСемейные вылазки в лес за грибами.\n\nШашлык во дворе, по субботам, с друзьями.\n\nЗимой, завсегда, лыжные эстафеты.\n\nА летом… О боже, что было бы летом!\n\nСоленья, компоты, полив помидоров.\n\nИ редкие – так, от усталости – ссоры.\n\nМой чай со смородиною и мелиссой\n\nв постель. Или вечером - под телевизор.\n\nЗакаты и стрёкот сверчков на террасе.\n\nШептание на ухо: «Ты - мое счастье»…\n\nДва ангела в доме, сопящих в кровати.\n\nТы, тихо снимающий летнее платье\n\nс меня, чтоб детей не будить…Твои руки,\n\nкоторых мне так не хватало б в разлуке\n\nпусть даже недолгой - по будням, когда мы\n\nс тобой на работе… Я б очень скучала…\n\nНо снова суббота. Потом воскресенье.\n\nМы дома, все вместе, с клубничным вареньем\n\nпьем чай со смородиною и мелиссой…',NULL,NULL,NULL,NULL,'Нет','высшее',NULL,NULL,NULL,'Есть, живём вместе','Хорошо зарабатываю / обеспечена',NULL,28,'undefined','http://www.mamba.ru/ru/mb1186390829?hit=10&fromsearch&sp=108',NULL,NULL,NULL,'2015-01-08 12:21:27',1,'mb1186390829'),(420,'Близнецы','undefined',162,50,'Обычное','Европейская','Нет',NULL,'Гетеро',NULL,NULL,'Есть, живём вместе',NULL,NULL,26,' Была давно','http://www.mamba.ru/ru/mb1196128261?hit=10&fromsearch&sp=106',NULL,NULL,NULL,'2015-01-08 12:21:35',1,'mb1196128261'),(421,'Россия','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,28,' Была давно','http://www.mamba.ru/ru/mb1186597053?hit=10&fromsearch&sp=108',NULL,NULL,NULL,'2015-01-08 12:21:35',1,'mb1186597053'),(422,'Дева','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,27,' Была давно','http://www.mamba.ru/ru/mb1186620438?hit=10&fromsearch&sp=58',NULL,NULL,NULL,'2015-01-08 12:21:42',1,'mb1186620438'),(423,'Россия','Моего Мужч