не так тяжело идти.\nЕсли он упадёт, я не буду вперёд тащить,\n\nпросто рядом присяду и дам ему отдохнуть.\n\nЯ его не укрою, как самый надёжный щит,\n\nно подам ему меч - тот, который нельзя согнуть.\nЕсли он позовёт, то я просто пойду за ним\n\nбез раздумий, сомнений, упрёков и всяких \"но\".\n\nМежду нами невидимо вьётся тугая нить...\n\nЕсли я позову - он вот так же пойдёт за мной.',176,80,'Плотное','Европейская',NULL,'высшее','Гетеро','Не курю','Пью в компаниях изредка','Нет, но хотелось бы','Стабильный средний доход','Комната в общежитии, коммуналка',28,' Была месяц назад','http://www.mamba.ru/ru/mb1228766298?hit=10&fromsearch&sp=97',NULL,NULL,NULL,'2015-01-08 12:37:45',1,'mb1228766298'),(544,'Близнецы','undefined',NULL,NULL,'Спортивное','Европейская','Нет','высшее',NULL,'Не курю','Пью в компаниях изредка',NULL,NULL,'Отдельная квартира (снимаю или своя)',26,'undefined','http://www.mamba.ru/ru/mb1229148629?hit=10&fromsearch&sp=97',NULL,NULL,NULL,'2015-01-08 12:38:01',1,'mb1229148629'),(545,'Водолей','undefined',181,NULL,'Плотное','Смешанная','Ничего серьёзного','высшее','Гетеро','Курю редко','Пью в компаниях изредка','Нет',NULL,NULL,28,' Была давно','http://www.mamba.ru/ru/mb1229243740?hit=10&fromsearch&sp=97',NULL,NULL,NULL,'2015-01-08 12:38:10',1,'mb1229243740'),(546,'Водолей','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,' Была давно','http://www.mamba.ru/ru/mb1229630530?hit=10&fromsearch&sp=96',NULL,NULL,NULL,'2015-01-08 12:38:19',1,'mb1229630530'),(547,'Козерог','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,30,' Была сегодня в 10:10','http://www.mamba.ru/ru/mb1229896110?hit=10&fromsearch&sp=96',NULL,NULL,NULL,'2015-01-08 12:38:27',1,'mb1229896110'),(548,'Россия','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,' Была в течение недели','http://www.mamba.ru/ru/mb1230413528?hit=10&fromsearch&sp=96',NULL,NULL,NULL,'2015-01-08 12:38:33',1,'mb1230413528'),(549,'Близнецы','ищу просто