ходит.\nСкажешь, что искать любовь на сайте знакомств – нелепица, в которую уже давно перестали верить его посетители.\nНо знаешь, когда-то давно люди искренне верили в то, что наша Земля – плоская…\nИ тогда нашелся всего один человек, который смог ценой собственной жизни доказать остальным, что они ошибались…\nНо мне кажется что ты здесь потому, что в твоей жизни не хватает человека. Человека, у которого можно будет сладко задремать на плече в кресле самолета. \nТого, кто будет вслух читать тебе перед сном твою любимую книгу и делать еще тысячи вещей с тобою вместе, которые сейчас ты делаешь в одиночестве…\nЯ не знаю что произойдет когда мы с тобой встретим друг друга: можем долго о чем-то будем переписываться или болтать по телефону, а может, начав разговор за чашкой согревающего эспрессо в уютном кафе поздним вечером, утром проснемся, сжимая друг друга в объятьях…\nКак бы не обернулось наше знакомство, если мои слова что-то задели в твоей душе – дай нашему знакомству начаться. Напиши мне. Может быть мы найдем общий язык и вместе уйдем с этого сайта.',174,53,'Худощавое','Европейская',NULL,'высшее','Гетеро',NULL,NULL,NULL,NULL,NULL,30,' Была в течение недели','http://www.mamba.ru/ru/mb1371334096?hit=10&fromsearch&sp=14',NULL,NULL,NULL,'2015-01-08 13:52:35',1,'mb1371334096'),(1036,'Лев','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,31,' Была месяц назад','http://www.mamba.ru/ru/mb1371515420?hit=10&fromsearch&sp=24',NULL,NULL,NULL,'2015-01-08 13:52:44',1,'mb1371515420'),(1037,'Рыбы','undefined',NULL,NULL,NULL,NULL,'Нет',NULL,'Гетеро','Курю','Пью в компаниях изредка','Нет',NULL,NULL,23,' Была в течение недели','http://www.mamba.ru/ru/mb1371524819?hit=10&fromsearch&sp=24',NULL,NULL,NULL,'2015-01-08 13:52:53',1,'mb1371524819'),(1038,'Россия','undefined',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,' Была месяц назад','http://www.mamba.ru/ru/mb1371640720?hit=10&fromsearch&sp=24',NULL,NULL,NULL,'2015-01-08 13:53:01',1,'mb1371640